INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'page', 0, 3, 3, 'und', 0, 'Diablo 3 Guide Review is a site to help dedicated gamers find the information they need to go far and beyond other players.  With the right guide, your friends won''t believe how much better you are than them!\r\n\r\nHere''s your chance to get all of the tips, strategies and hints that the top Diablo 3 Pros and Gosus are using out there. This must be shared! It’s unfair to have them hog all the best items to themselves and you learn it all in these guides.\r\n\r\nDon’t let the chance to become the biggest, best new player in Diablo 3 around to pass you by. I’m not kidding when I say this is going to go up, and then there are the other people who will be swooping in to make their characters the top of the line. Act now and become the dominant player you’ve always dreamed of being. This is your chance to shine!\r\n', '', 'filtered_html'),
('node', 'page', 0, 4, 4, 'und', 0, 'To reach Diablo 3 Guide Review, send an email to:\r\n\r\ncdp.advertising@gmail.com', '', 'filtered_html'),
('node', 'front_page_review', 0, 5, 5, 'und', 0, '<h2><strong><a href="http://438ae9pg95ayfsbb7-vgp9w88l.hop.clickbank.net/?tid=1" target="_top">Diablo 3 Billionaire</a></strong></h2>', '', 'full_html'),
('node', 'page', 0, 6, 6, 'und', 0, '<strong>5/5</strong> - It''s well-stacked with great content that will go a long, long way. I know there''s going to be a lot of gold made from players that take advantage of this one... In fact, I''ve had some great success using the package... I''ve turned one tip into over 175,000 gold with very little effort, about an 8 minute run to be exact! Now that I have it set up, I run it over and over again... And every time I do, it cranks me more gold. ', '', 'filtered_html'),
('node', 'page', 0, 7, 7, 'und', 0, '<strong>4.5/5</strong> - The guides here are all written by some of the best players in the world. Many of them hail from top 10 guilds such as Ensidia, Premonition, and Exodus from World of Warcraft, or Maximization from Rift. We also have PvP experts that reached Gladiator status in World of Warcraft across multiple seasons, brackets, and classes.', '', 'filtered_html'),
('node', 'front_page_review', 0, 8, 8, 'und', 0, '<h2><strong><a href="http://7f7b30jmf14-3o486cvbng0i3a.hop.clickbank.net/?tid=1" target="_top">Diablo 3 Guide - Inferno Codex</a></strong></h2>', '', 'full_html'),
('node', 'front_page_review', 0, 9, 9, 'und', 0, '<h2><strong><a href="http://62917xlo74fwfs9yioy5m-fs6s.hop.clickbank.net/?tid=1" target="_top">Diablo 3 Speed</a></strong></h2>', '', 'full_html'),
('node', 'page', 0, 10, 10, 'und', 0, '<strong>4/5</strong> - The name of the game is speed… In just a few minutes, you will discover a secret cache of valuable information on how you can massively sprint your way through Diablo 3 games and experience a level of advancement like no one else on the Internet even if your installation DVD is still fresh in its wrapping!', '', 'filtered_html'),
('node', 'front_page_review', 0, 11, 11, 'und', 0, '<h2><strong><a href="http://1428b1mdau5qek9-jb1jll8vd8.hop.clickbank.net/?tid=1" target="_top">Diablo 3 Gold Secrets</a></strong></h2>', '', 'full_html'),
('node', 'page', 0, 12, 12, 'und', 0, '<strong>3.5/5</strong> - This is not some hastily thrown together, crummy pdf file with one or two "secrets" to impress you. In actuality, this is a living, constantly updated guide to dominating Diablo 3''s auction houses. It''s supported by an entire legion of active expert gamers, all chomping at the bit to teach you how to be a better auctioneer. ', '', 'filtered_html');
