INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(3, 'node', ' about diablo 3 guide review is a site to help dedicated gamers find the information they need to go far and beyond other players with the right guide your friends won t believe how much better you are than them here s your chance to get all of the tips strategies and hints that the top diablo 3 pros and gosus are using out there this must be shared it s unfair to have them hog all the best items to themselves and you learn it all in these guides don t let the chance to become the biggest best new player in diablo 3 around to pass you by i m not kidding when i say this is going to go up and then there are the other people who will be swooping in to make their characters the top of the line act now and become the dominant player you ve always dreamed of being this is your chance to shine  ', 0),
(4, 'node', ' contact to reach diablo 3 guide review send an email to  cdpadvertising gmailcom ', 0),
(5, 'node', ' rating 1 diablo 3 billionaire ', 1341620185),
(6, 'node', ' review 1 55  it s wellstacked with great content that will go a long long way i know there s going to be a lot of gold made from players that take advantage of this one in fact i ve had some great success using the package i ve turned one tip into over 175000 gold with very little effort about an 8 minute run to be exact now that i have it set up i run it over and over again and every time i do it cranks me more gold  ', 0),
(7, 'node', ' review 2 455  the guides here are all written by some of the best players in the world many of them hail from top 10 guilds such as ensidia premonition and exodus from world of warcraft or maximization from rift we also have pvp experts that reached gladiator status in world of warcraft across multiple seasons brackets and classes  ', 0),
(8, 'node', ' rating 2 diablo 3 guide inferno codex ', 1341620209),
(9, 'node', ' rating 3 diablo 3 speed ', 1341620234),
(10, 'node', ' review 3 45  the name of the game is speed in just a few minutes you will discover a secret cache of valuable information on how you can massively sprint your way through diablo 3 games and experience a level of advancement like no one else on the internet even if your installation dvd is still fresh in its wrapping  ', 0),
(11, 'node', ' rating 4 diablo 3 gold secrets ', 1341620254),
(12, 'node', ' review 4 355  this is not some hastily thrown together crummy pdf file with one or two secrets to impress you in actuality this is a living constantly updated guide to dominating diablo 3 s auction houses it s supported by an entire legion of active expert gamers all chomping at the bit to teach you how to be a better auctioneer  ', 0);
